// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;



contract transcation {
    bool public status = true;
    enum state{pending,success,failure}
    state public s1;
    function setstate(state _tempstate) public{
        s1 = _tempstate;    
    }


    function changestatus() public{
        if(status==true){
            s1 = state.success;
            status = false;
        }
        else{
            s1 = state.failure;
            status = true;
        }

    }
}

